import React, { Component } from 'react';
import Card from './components/Card';
import Switch from './components/Switch';
import './theme.css';
export default class App extends Component {
	render() {
		return (
			<div className="Circle">
				<Card />
				<Switch />
			</div>
		);
	}
}
